import React, { Component } from 'react'

export default class StateInClass extends Component {
    constructor(props){
        super(props);
        this.state = {
            id: props.id,
            name: props.name, 
        };
    }
    render() {
        return <div><p>ID : {this.state} </p> {this.state.name} </div>;
        
    }
}
